import "./App.css";
import CreateUser from "./components/User/CreateUser";
import CreateUser_temp from "./components/User/CreateUser_temp";
import ShowUser from "./components/User/ShowUser";
import ShowUser_temp from "./components/User/ShowUser_temp";
import { Route, Routes } from "react-router-dom";
import EditUser from "./components/User/EditUser";
import EditUser_temp from "./components/User/EditUser_temp";
import User from "./components/User/User";
import User_temp from "./components/User/User_temp";
import Header from "./components/Common/Header";
import Home from "./components/Layout/Home";
import URLhdl from "./components/Common/Handler";
function App() {
    return (
        <div className="App">
            <header className="container">
                <div className="">
                    <Header />
                    <Routes>
                        <Route path={URLhdl()["home"]} element={<Home />} />
                        <Route
                            path="/edit-user/:id"
                            element={<EditUser_temp />}
                        />
                        <Route path="/user/:id" element={<User_temp />} />
                        <Route
                            path="/create-user"
                            element={<CreateUser_temp />}
                        />
                        <Route path="/show-user" element={<ShowUser_temp />} />
                    </Routes>
                </div>
            </header>
        </div>
    );
}

export default App;
